// src/pages/UsersBookingDates.js
import React from 'react';
import Dates from '../components/Dates'; // Import the Dates component

const UsersBookingDates = () => {
  return (
    <div>
      <h1>User Booking Dates</h1>
      <Dates />
    </div>
  );
};

export default UsersBookingDates;
